import React from "react";
import styled from "styled-components";
import { SmallSubtitle, FatTitle, Labor } from "../styled/typos";
const member = props => {
  const { dataMember } = props;
  console.log(props.even);

  const MemberSmallSubtitle = styled(SmallSubtitle)`
    color: ${props.even
      ? props => props.theme.colors.black
      : props => props.theme.colors.white};
  `;
  const Container = styled.div`
    position: relative;
    background-color: ${props.even
      ? props => props.theme.colors.white
      : props => props.theme.colors.black};
  `;
  const Line = styled.hr`
    border: 0.5px solid
      ${props.even
        ? props => props.theme.colors.white
        : props => props.theme.colors.black};
    transform: rotate(90deg);
    width: 115px;
  `;
  return (
    <Container>
      <MemberSmallSubtitle>{dataMember.subTitle}</MemberSmallSubtitle>
      <FatTitle>{dataMember.name}</FatTitle>
      <Line />
      <Labor>{dataMember.description}</Labor>

      <Flex>
        <SmallSubtitle>{dataMember.engagements.subTitle}</SmallSubtitle>
        <hr />
      </Flex>
      <Labor>{dataMember.engagements.description}</Labor>
    </Container>
  );
};

export default member;

const Flex = styled.div`
  display: flex;
`;
